zombieModel={paramSettingsHtmlFile:"models/sample/zombie-model-sample.html",setup:function(){zombieModel.params={biteChance:20,growthRate:5};document.getElementById("biteChance").innerHTML=this.params.biteChance;$("#slider-spread").slider({value:zombieModel.params.biteChance,min:0,max:100,step:1,slide:function(a,b){zombieModel.params.biteChance=b.value;document.getElementById("biteChance").innerHTML=zombieModel.params.biteChance}});document.getElementById("growthRate").innerHTML=this.params.growthRate;$("#slider-growth").slider({value:zombieModel.params.growthRate,min:0,max:100,step:1,slide:function(a,b){zombieModel.params.growthRate=b.value;document.getElementById("growthRate").innerHTML=zombieModel.params.growthRate}})},nextIteration:function(h,n){var b=this.params.biteChance/100;var o=this.params.growthRate/100;var c=h.humans;var k=h.zombies;var i=c+k;var g=0;if(c>0){g=Math.floor((k*c*b)/i)}c-=g;k+=g;for(var m in n){var a=n[m].zombies;if(c>0&&a>0){var f=n[m].humans;var e=c+f+a+c;var l=Number(Math.floor((b*c*a)/e));k+=l;c-=l}}var j=Math.floor(c*o);c+=j;var d=zombies.zombiePercentage(k,c);return{zombies:k,humans:c,percentage:d}}};